import { useState } from "react";
import Logout from "./Logout";

function Login({login}) {
    const [id, setId] = useState("")
    const [mdp, setMdp] = useState("")

    return (
    <form method="POST" action="">
        <label htmlFor="login">Login</label><input type="text" id="login" onChange={setId}></input><br/>
        <label htmlFor="mdp">Mot de passe</label><input type="password" id="mdp" onChange={setMdp}></input><br/>
        <button type="submit" on onClick={login}>Log In</button><button type="reset">Annuler</button>
    </form> );
}

export default Login
